import React from "react";

import { loadPokedata } from "../api";
const getPokeData = () => {
  const data = loadPokedata();
  console.log(data);
  return data.results;
};
const PokeDash = () => {
  console.log(getPokeData());
  return <div className=""></div>;
};

export default PokeDash;
